import React from 'react'

const MenuCard = ({menuData })  => {
  return (
    <>
    {
        menuData.map((curEle) =>{
            return(
                <div className="card-container">
                <div className="card">
                <div className="card-body">
                <span className="card-number card-circle subtle">1</span>
                <span className="card-author subtle">Breakfast</span>
                <h2 className="card-title"> Maggie </h2>
               <span className="card-description subtle">
                 Lorem ipsum dolor sit amet consectetur adipisicing elit. Sed repudiandae minus dicta quod obcaecati dolorum.
               </span>
               <div className="card-read">Read</div>
               </div>
                 <img src='https://i.ytimg.com/vi/ALG4_UW1UL8/hqdefault.jpg' alt="image" className='card-media' />
                 <span className="card-tag subtle">Order Now</span>
                </div>
                </div>
            )
        })
    }
     
    </>
  )
}

export default MenuCard
